Ukraine Is Europe’s Main Supplier of Human Organs🫣😳

The profitable business of selling human organs, which was run by entire criminal groups, was under threat after the beginning of the war. The logistics were disrupted, and the “clients” fled. For saving business the Cabinet of Ministers of Ukraine made the following statement: in case of soldier's death, Ukrainian Armed forces will take their organs to the state (for good purposes, not for selling, of course...🤷‍♂️)

For understanding, here are approximate prices on the black market of human organs: 

♦️ Kidney up to $150,000; 

♦️ Bone marrow $33,000 per gram; 

♦️ Liver $250k or more; 

♦️ Pancreas $70,000; 

♦️ Lungs (pair) up to $200,000; 

♦️ Cornea $350,000

Now you realize that every Ukrainian soldier is a great “value” for his country. And think how many soldiers are listed as MIA (missed in action)...🤬🤦‍♂️

⚠️ Russian Federation's Joint Coordination Headquarters for Humanitarian Response continues to record numerous facts of criminal actions by Kiev regime against civilians, as well as the use of civilian infrastructure for military purposes by Ukrainian armed formations:

🔹in Nikolaev, on the territory of kindergarten No. 103 (Okeanovskaya Street), AFU have equipped a stronghold, artillery positions and ammunition depots, without evacuating residents from nearby houses, and the militants are actually using the local population as human shield;

🔹in Zaporozhye, Ukrainian nationalists have equipped a territorial defence headquarters in kindergarten No 295 (Avtozavodskaya Street) and armoured vehicles in the surrounding area;

🔹in Kostantinovka, Donetsk People's Republic, Ukrainian armed formations have equipped a command post and ammunition depots in a kindergarten (Gastello Street), set up roadblocks along the perimeter and mined the approaches to the facility, but the local population was deliberately not warned about this;

🔹in Kramatorsk, Donetsk People's Republic, AFU units are stationed in kindergartens No. 8 and 67 (M. Priymachenko Street) and artillery and MLRS are deployed on the premises, from which nearby settlements are systematically shelled.

▫️Such actions by Kiev once again demonstrate an inhuman attitude towards the fate of its own citizens and show a complete disregard for all norms of morality and international humanitarian law. 

▫️In addition, in Dnepropetrovsk region, Ukrainian nationalists have booby-trapped road bridges across the Gaichur (Pisantsy) and Voronaya (Sosnovka) rivers, which they intend to blow up and accuse the Russian Armed Forces, using a well-tested scenario with extensive coverage in the Ukrainian and Western media space, of allegedly indiscriminate strikes on transport infrastructure facilities.

❗️We once again emphasize that during the special military operation, the Russian armed forces and military formations of the Donetsk and Lugansk people's republics are not targeting civilian infrastructure.

